import React from "react";
import { Link } from "react-router-dom";
import "./Styles/Navbar/Navbar.css";
import Logo from "../img/logo.png";

export const Navbar = () => {
  return (
    <div className='navbar'>
        <Link to="/">
            <img src={Logo} alt="InstaLogo" />
        </Link>
        <ul className="nav-menu">
            <Link to="signUp">
                <li>Sign Up</li>
            </Link>
            <Link to="signIn">
                <li>Sign In</li>
            </Link>
            <Link to="profile">
                <li>Profile</li>
            </Link>
        </ul>
    </div>
  )
}
